import React from 'react'
import '../App.css'

const errorMsg = ({message}) => {
    if (message === null){
        return null
    }
    return (
        <div className='error'>
            {message}
        </div>
    )
}

const successMsg = ( {message} ) => {
    if (message === null){
        return null
    }
    return (
        <div className='success'>
            {message}
        </div>
    )
}


export default {
    errorMsg,
    successMsg
}
